webpackJsonp([0xe0ec83c1e22b],{6302:function(e,t){e.exports={data:{post:{html:'<p>The second semi-periodic <a title="Hamburg Blog Meet, part 2 by Heiko Hebig | hebig.com" href="http://www.hebig.com/archives/001382.html">Hamburg</a>  <a title="Lyssas Lounge - taking confusion to a higher level" href="http://lyssaslounge.diaryland.com/030814_31.html">Blogger</a> <a title="Noch\'n Blogg.: 2. Hamburger Blogger-Treffen" href="http://lumma.de/mt/archives/000482.html#000482">Meeting</a> has been scheduled for next Thursday evening, 21 Aug, in the Marktstube (Marktstr. 119) at 7:30 pm.</p>\n<p>Admission is by invitation only and costs $500.</p>\n<p>Just <a href="http://blogs.law.harvard.edu/bloggerCon/discuss/msgReader$82?mode=topic">kidding</a>. But if you plan to show up, an <a href="mailto:bloggtreffen@orangemedia.de">email to the organizers</a> would be nice, so they can reserve an appropriate table.</p>',fields:{title:"2nd Hamburg Blogger Meeting",date:"14 Aug 2003",url:"https://papascott.de/2003-08-14-2nd-hamburg-blogger-meeting/"}}},pathContext:{slug:"/2003-08-14-2nd-hamburg-blogger-meeting/",prev:{fields:{title:"Just Call Me Ami",date:"13 Aug 2003",slug:"/2003-08-13-just-call-me-ami/"}},next:{fields:{title:"Hey, cool, I broke my weblog!",date:"14 Aug 2003",slug:"/2003-08-14-hey-cool-i-broke-my-weblog/"}}}}}});
